import React from 'react';
import {StyleSheet, View} from 'react-native';
import {Icon, Nav, Sidenav} from 'rsuite';
import 'rsuite/dist/styles/rsuite-default.css';
const Mystyle = {
  navWidth: {
    fontSize: '100px',
  },
  navHeight: {
    height: '100vh',
    paddingLeft: '10px',
  },
  backgroundColor: {
    backgroundColor: 'white',
    width: '80px',
  },

  iconSpacing: {
    padding: '10px',
    alignItems: 'center',
  },
  iconSize: {
    fontSize: '30px',
  },
};
function NavbarV() {
  return (
    <View style={StyleSheet.flatten([Mystyle.navWidth])}>
      <Sidenav
        style={StyleSheet.flatten([Mystyle.backgroundColor])}
        expanded={false}
        defaultOpenKeys={['2', '4']}
        activeKey="2"
      >
        <Sidenav.Body>
          <Nav style={StyleSheet.flatten([Mystyle.navHeight])}>
            <Nav.Item
              eventKey="1"
              style={StyleSheet.flatten([Mystyle.iconSpacing])}
              icon={
                <Icon
                  icon="dashboard"
                  style={StyleSheet.flatten([Mystyle.iconSize])}
                />
              }
            ></Nav.Item>
            <Nav.Item
              eventKey="2"
              style={StyleSheet.flatten([Mystyle.iconSpacing])}
              icon={
                <Icon
                  icon="group"
                  style={StyleSheet.flatten([Mystyle.iconSize])}
                />
              }
            ></Nav.Item>
            <Nav.Item
              eventKey="3"
              style={StyleSheet.flatten([Mystyle.iconSpacing])}
              icon={
                <Icon
                  icon="mortar-board"
                  style={StyleSheet.flatten([Mystyle.iconSize])}
                />
              }
            ></Nav.Item>
            <Nav.Item
              eventKey="4"
              style={StyleSheet.flatten([Mystyle.iconSpacing])}
              icon={
                <Icon
                  icon="lock"
                  style={StyleSheet.flatten([Mystyle.iconSize])}
                />
              }
            ></Nav.Item>
            <Nav.Item
              eventKey="5"
              style={StyleSheet.flatten([Mystyle.iconSpacing])}
              icon={
                <Icon
                  icon="universal-access"
                  style={StyleSheet.flatten([Mystyle.iconSize])}
                />
              }
            ></Nav.Item>
            <Nav.Item
              eventKey="6"
              style={StyleSheet.flatten([Mystyle.iconSpacing])}
              icon={
                <Icon
                  icon="key"
                  style={StyleSheet.flatten([Mystyle.iconSize])}
                />
              }
            ></Nav.Item>
            <Nav.Item
              eventKey="7"
              style={StyleSheet.flatten([Mystyle.iconSpacing])}
              icon={
                <Icon
                  icon="link"
                  style={StyleSheet.flatten([Mystyle.iconSize])}
                />
              }
            ></Nav.Item>
            <Nav.Item
              eventKey="8"
              style={StyleSheet.flatten([Mystyle.iconSpacing])}
              icon={
                <Icon
                  icon="gear-circle"
                  style={StyleSheet.flatten([Mystyle.iconSize])}
                />
              }
            ></Nav.Item>
          </Nav>
        </Sidenav.Body>
      </Sidenav>
    </View>
  );
}
export default NavbarV;
